import React from 'react';
import { Typography, Box, List, ListItem, ListItemText } from '@mui/material';

const WorkExperience = () => {
  return (
    <Box id="work-experience" sx={{ p: 2 }}>
      <Typography variant="h4" gutterBottom>Work Experience</Typography>
      <List>
        <ListItem>
          <ListItemText primary="Job Title 1" secondary="Company 1 (Date)" />
        </ListItem>
        <ListItem>
          <ListItemText primary="Job Title 2" secondary="Company 2 (Date)" />
        </ListItem>
        {/* Add more work experiences as needed */}
      </List>
    </Box>
  );
};

export default WorkExperience;
